description:
Chị Huyền trẻ tuổi xinh đẹp đã mua nhà trong phố cho tiện đi lại, không dùng nên bán nhà đường Lạc Long Quân, Tây Hồ;
Khu vực Nhật Tân hàng xóm Ciputra và Sunshine Riverside, gần trường C3 Tây Hồ, cấp 2 Nhật Tân, một đoạn ra Lotte, đi bộ ra UBND;
Ngõ nhà mình thẳng tắp thông sang phố Nhật Chiêu, hồ Tây, ngấn ga là ra Võ Chí Công, An Dương Vương, chỉ 15 phút là ra sân bay;
Nhà thiết kế thông sàn kiểu hiện đại với những cửa sổ lớn và ban công rộng, xây không hết đất, trước có sân nhỏ, décor theo phong cách cute;
Giá bao gồm tặng lại toàn bộ nội thất cho khách thiện chí.
